export const GridAllTrips = styled.div`
    margin-top: 20px;
    display: grid;
    grid-template-columns: 1fr 1fr 1fr;
    grid-template-rows: 40vh 40vh;
    position: absolute;
    top: 10vh;
    justify-items: center;
    align-items: center;
`
